{"detail_content": "The Simpsons is an animated sitcom centering on a working-class American family living in the fictional town of Springfield.

The multi-award-winning animated show was created by Matt Groening, James L. Brooks and Sam Simon. Groening has also created the sci-fi sitcom Futurama and the medieval comedy, Disenchantment. Since airing its first episode in 1989, the long-running show has become one of the most famous TV shows of all time.
